import React from 'react'
import "../stylesheets/Navbar.css"

class Navbar extends React.Component {


    render() {
        return(
            <div id="navbar-wrapper">
                    <div>HOME</div>
                    <div>ABOUT</div>
                    <div>PORTFOLIO</div>
                    <div>BLOG</div>
                    <div>CONTACT</div>
            </div>
        )
    }
}

export default Navbar
